from typing import List
class Solution:
    def findMaxConsecutiveOnes(self, nums: List[int]) -> int:
        l = r = max_len = 0

        while r < len(nums):
            if nums[r] == 1:
                r += 1
            else:
                r += 1
                l = r
            max_len = max(max_len, r - l)
        return max_len


